import React from 'react';

const toHslString = (h, s, l) => `hsl(${h}, ${s}%, ${l}%)`;

const hexToRgb = hexString => {
  let r = 0,
    g = 0,
    b = 0;

  r = '0x' + hexString[1] + hexString[2];
  g = '0x' + hexString[3] + hexString[4];
  b = '0x' + hexString[5] + hexString[6];

  return [+r, +g, +b];
};

const isDark = hex => hexToRgb(hex).every(val => val < 180);

const ColorCell = ({ color }) => {
  const name = color.color.name;
  const hex = color.color.hex;
  const hsl = color.color.hsl;
  const rgb = color.color.rgb;
  console.log(color);
  return (
    <div className='color-cell'>
      <p>{name}</p>
    </div>
  );
};

export default ColorCell;
